"use strict";export const consoleTime=(()=>{const e=new Map,r=1e4;return Object.freeze({begin(t="default"){if(!(e.has(t)||e.size>=r))return e.set(t,performance.now()),0},log(r="default"){if(!e.has(r))return;const t=e.get(r),n=performance.now(),o=n-t;return o},end(r="default"){if(!e.has(r))return;const t=e.get(r),n=performance.now(),o=n-t;return e.delete(r),o}})})();